import {useState} from 'react';

import Button from './Button'

function Contacts(){ 
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    var success = true;

    async function getContacts(e){
        var userID = localStorage.getItem("userID");

        e.preventDefault();
        const res = await fetch('http://localhost:3001/contacts/' + userID, {
            method: 'POST',
            credentials: 'include',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                username: username,
                password: password,
            })
        });

        var status = await res.status;
        var data = null;

        if(status === 201){
            data = await res.json();
        } 
        else{
            success = false;
        }

        console.log(data);
    }

    return <div><Button text="Contacts" onClick={getContacts}/></div>;
}

export default Contacts;
